import { Card } from "@mui/material";
import { Box } from "@mui/system";


export const CartProduct = () => {

    return(
        <>
        <Box 
        display="flex"
        justifyContent="center"
        alignItems="center"
        height="100vh"
        sx={{ backgroundColor: "grey" }}>
             <Card variant="outlined" sx={{
                    maxWidth: '400px',
                    height: "450px",
                    p: 2,
                    overflow: 'visible',
                    background: '#d0d0d0'
                }}></Card>
    
        </Box>
        </>
    )
}
